  return (
    <div>
      <header className="App-header">
        <h1>Find a Person</h1>
        <Tabs>
          <div label="Registro Persona Extraviada">
            <LostPerson />
          </div>
          <div label="Personas Encontradas">
            <LostPerson />
          </div>
          <div label="Tabla de Personas ">
            <TableLostPeople />
          </div>
        </Tabs>
      </header>
    </div>
  );
}

export default App;
